window.bookSummaryJSON = "<h4><b>Series is finished!<br><br>What do you get when you combine a coma-inducing career, an ardent academic, and a nefarious nemesis?<br><br>A Vicki Bohanan hangover cocktail.</b></h4><br>Your favorite bartender babe is back and cutting a trail through a new vocation, with a college class tucked between briefs instead of sheets, and an alarm clock in two – er, tow. It’s no secret that a sleep-deprived Vicki is a volatile Vicki.<br><br>Especially when a certain Texas Ranger goes MIA.<br><br>And her first official case involves one pageanted Padget accused of killing her fiancé.<br><br>Even as her recently resuscitated relationship with Zeke Taylor hits a skid mark visible from the International Space Station, it’s up to Vicki to put aside old rivalries to solve the mystery and rescue a former beauty queen from the guillotine – before her secret pops out.<br><br>And before the murderer strikes again.<br><br>Garfield’s not the only one who hates mornings. Witness the cat fur hit the fan as the claws come out in book four of the Bartender Babe Chronicles, the laugh-out-loud mystery romance series that readers of Janet Evanovich are calling the “Texas Stephanie Plum”."; 
